import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import Sdata from "./Sdata";
import "./index.css";

// console.log(Sdata[0].sname);

ReactDOM.render(
    <>
    <h1 className="heading_style"> List of top 5 Netflix Series in 2024</h1>
    <Card 
        imgsrc={Sdata[0].imgscr} 
        sname={Sdata[0].sname}
        title={Sdata[0].title}
        link={Sdata[0].link}
    />

    <Card 
        imgsrc={Sdata[1].imgscr} 
        sname={Sdata[1].sname}
        title={Sdata[1].title}
        link={Sdata[1].link}
    />

    <Card 
        imgsrc={Sdata[3].imgscr} 
        sname={Sdata[3].sname}
        title={Sdata[3].title}
        link={Sdata[3].link}
    />

    <Card 
        imgsrc={Sdata[4].imgscr} 
        sname={Sdata[4].sname}
        title={Sdata[4].title}
        link={Sdata[4].link}
    />

    <Card 
        imgsrc={Sdata[4].imgscr} 
        sname={Sdata[4].sname}
        title={Sdata[4].title}
        link={Sdata[5].link}
    /> 

    </>,
    document.getElementById('root')
)
